ORIGINAL_commentText:
سبحان الله لقد خلقنا الله فى احسن صوره  و على الرغم من عمليات التجميل و التقدم و التكنلوجيا و التطور و لكننا عندما نحاول تغيير مظهرنا او صوتنا لا نستطيع ان نجعله افضل مما خلقنا الله عليه سبحان الله  .      و 
لذلك فقد قال تعالى  {   (  3  )  لقد خلقنا الانسان فى احسن تقويم  (  4  )   }  
   {  فتبارك الله احسن الخالقين  (  14  )   }  
صدق الله العظيم 👐
